    "If kisses were currency, I‚Äôd be a billionaire with you.",
    "Do you have a name, or can I call you mine?",
  "Are you French? Because Eiffel for you.",
  "If you were a vegetable, you‚Äôd be a cute-cumber!",
  "Do you believe in love at first sight‚Äîor should I walk by again?",
  "Is your name Google? Because you‚Äôve got everything I‚Äôm searching for.",
"If you were a cat, you‚Äôd purr-fectly fit in my heart.",
"Are you a campfire? Because you‚Äôre hot and I want s‚Äômore.",
"If beauty were a crime, you‚Äôd be serving a life sentence.",
"Are you made of sugar? Because you‚Äôre so sweet it‚Äôs unreal.",
"Do you like science? Because I've got my ion you.",
"Are you a keyboard? Because you‚Äôre just my type.",
"Can I follow you home? Because my parents always told me to follow my dreams.",
"Are you an equation? Because you complete my formula.",
"Do you have a Band-Aid? I just scraped my knee falling for you.",
"If you were a song, you'd be the best track on the album.",
"Are you a charger? Because without you, I'd die.",
"You're so dazzling, even the stars are jealous.",
"Are you a spell? Because you‚Äôve enchanted me.",
"If you were words on a page, you‚Äôd be fine print.",
"Are you a sunrise? Because you brighten my day from the start.",
"Do you have sunscreen? Because you just burned me with your smile.",
"Are you a pizza? Because I‚Äôd never get tired of you.",
"You must be an artist, because you just drew me in.",
"Are you caffeine? Because you‚Äôve got me all energized.",
"Are you an app? Because I can‚Äôt stop clicking with you.",
"If kisses were currency, I‚Äôd be a billionaire with you.",
"Are you a light switch? Because you turn me on.",
"Are you summer? Because you‚Äôre making me sweat.",
"Do you have a mirror in your pocket? Because I see myself in your pants‚Äîoops, heart!",
"Are you a hacker? Because you just cracked my heart.",
"Are you WiFi? Because I‚Äôm totally connected.",
"Is your dad a pilot? Because you‚Äôre fly as heck.",
"Are you a fire alarm? Because you‚Äôre smokin‚Äô!",
"You must be made of stardust, because you shine like the cosmos.",
"Are you Netflix? Because I could watch you all day.",
"Are you gravity? Because you‚Äôve got me falling for you.",
"Are you lightning? Because you just struck me.",
"Are you a page-turner? Because I can‚Äôt wait to read more about you.",
"Are you French? Because Eiffel for you.",
"If kisses were snowflakes, I‚Äôd send you a blizzard.",
"Are you made of copper and tellurium? Because you're Cu-Te.",
"If I could rearrange the alphabet, I‚Äôd put U and I together.",
"Are you a magician? Because whenever you're around, everything else disappears.",
"You must be a sunset, because you're lighting up my world.",
"You don‚Äôt need keys to drive me crazy.",
"Do you have a name, or can I call you mine?",
"I didn‚Äôt believe in love at first sight ‚Äî until I saw you.",
"Can I follow you home? Because my parents always told me to follow my dreams.",
"Do you like raisins? How do you feel about a date?.",
"Are you a loan from a bank? Because you have my interest!",
"I‚Äôm not a photographer, but I can picture us together.",
"Is your name Wi-Fi? Because I'm feeling a strong connection.",
"Are you cake? Because I want a piece of you.",
"If beauty were time, you‚Äôd be an eternity.",
"I‚Äôm not flirting.I‚Äôm just being extra nice to someone who's extra attractive.",
"I hope your day is as nice as your smile ‚Äî and your DMs are open."

  ];

  const generateLine = () => {
    const randomLine = pickupLines[Math.floor(Math.random() * pickupLines.length)];
    setCurrentLine(randomLine);
  };

  const rateLine = (score) => {
    if (!currentLine) return alert("Please generate a line first!");

    const newRating = { line: currentLine, score };
    setRatings([...ratings, newRating]);

    if (score >= 4 && !favorites.includes(currentLine)) {
      setFavorites([...favorites, currentLine]);
    }

    setCurrentLine('');
  };

  const removeRating = (index) => {
    const removed = ratings[index];
    const newRatings = ratings.filter((_, i) => i !== index);
    setRatings(newRatings);

  
    if (favorites.includes(removed.line)) {
      setFavorites(favorites.filter(line => line !== removed.line));
    }
  };

 

  const averageRating = ratings.length === 0
    ? 0.0
    : (ratings.reduce((sum, item) => sum + item.score, 0) / ratings.length).toFixed(1);

  return (
    <section id="rate" className="py-5" style={{ background: "linear-gradient(135deg, #fceabb, #f8b500)" }}>
      <div className="container">
        <div className="card shadow-lg p-5 border-0 rounded-4 mx-auto" style={{
          background: "rgba(255, 255, 255, 0.85)",
          backdropFilter: "blur(8px)",
          maxWidth: "850px"
        }}>
          <h2 className="text-center text-dark fw-bold mb-4">
            <i className="bi bi-star-fill text-warning me-2"></i>Rate Pick-Up Lines
          </h2>

          <div className="text-center mb-4">
            <button className="btn btn-lg btn-outline-success mx-2" onClick={() => rateLine(5)}>üòç</button>
            <button className="btn btn-lg btn-outline-primary mx-2" onClick={() => rateLine(4)}>üòä</button>
            <button className="btn btn-lg btn-outline-warning mx-2" onClick={() => rateLine(3)}>üòê</button>
            <button className="btn btn-lg btn-outline-danger mx-2" onClick={() => rateLine(1)}>üôÑ</button>
          </div>

          <div className="text-center mb-3">
            <button className="btn btn-danger px-4 py-2 shadow-sm" onClick={generateLine}>
              üé≤ Generate New Line
            </button>
            <p className="mt-3 fs-5 fw-semibold">{currentLine}</p>
          </div>

          <p className="text-center text-muted fs-5 mb-4">
            Average Rating: <strong>{averageRating}</strong>
          </p>

          <div>
            <h5 className="text-dark fw-semibold">üìã Your Ratings</h5>
            <ul className="list-group mb-4 rounded-3 overflow-auto" style={{ maxHeight: "200px" }}>
              {ratings.map((item, index) => (
                <li key={index} className="list-group-item d-flex justify-content-between align-items-center">
                  {item.line}
                  <span className="badge bg-secondary me-3">Rating: {item.score}</span>
                  <button className="btn btn-sm btn-outline-danger" onClick={() => removeRating(index)}>
                    <i className="bi bi-x-lg"></i>
                  </button>
                </li>
              ))}
            </ul>

            <h5 className="text-dark fw-semibold mt-4">‚ù§Ô∏è Your Favorites</h5>
            <ul className="list-group rounded-3 overflow-auto" style={{ maxHeight: "200px" }}>
              {favorites.map((line, index) => (
                <li key={index} className="list-group-item d-flex justify-content-between align-items-center">
                  {line}
                  <button className="btn btn-sm btn-outline-danger" onClick={() => removeFavorite(index)}>
                    <i className="bi bi-trash-fill"></i>
                  </button>
                </li>
              ))}
            </ul>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Rating;
